import React from 'react';
import './login.scss';

export default function Login() {
  return (
    <div className='login'>
        <div className='login__leftCard'>

        </div>

        <div className='login__rightCard'>
            <h3>Login</h3>
            <form>
                <input type="text" placeholder='userName'/>
                <input type="password" placeholder='password'/>
                <button>Login-></button>
            </form>
        </div>
    </div>
  )
}
